 import React, {Component} from 'react';
 import {Text, View, Button} from 'react-native';



function HomeScreen({ navigation }) {
  return (
    <View >
      <Text>Home Screen</Text>
      <Button
        title="Go to Details"
        onPress={() => navigation.navigate('Stap')}
      />
    </View>
  );
}
export default HomeScreen;
